    color:   "danger",
    titulo: "Nuestros Productos",
   

};
<img className="img-profile" src={foto_3} width="60" alt='Imagen arte'/>


let amount ={
    color:   "success",
    titulo: "Nuetsras Ofertas",
    valor: 546,
    icono: "fa-dollar-sign",
    moneda: true
}



let cardProps = [productInDataBase,amount];


function ContentRowTop(){
    return (
        <React.Fragment>
        {/*<!-- Content Row -->*/}
        <div className="row">
            {
                cardProps.map((producto,index)=>{
                    return <SmallCard  {...producto}  key= {index}/>
                })
            }      
        </div>
        </React.Fragment>
    )
}
export default ContentRowTop;
